import math

def isprime(n):
    if n < 1:
        return False
    if n <= 3:
        return True
    if n % 2 == 0 or n % 3 == 0:
        return False
    i = 5
    while i * i <= n:
        if n % i == 0 or n % (i + 2) == 0:
            return False
        i += 6
    return True

def primefactors(n):
    factors = {}
    count = 0
    while n % 2 == 0:
        n /= 2
        count += 1
    if count > 0:
        factors[2] = count
    for i in range(3, int(math.sqrt(n)) + 1, 2):
        count = 0
        while n % i == 0:
            n /= i
            count += 1
        if count > 0:
            factors[i] = count
    if n > 2:
        factors[n] = 1
    return factors

